import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

const isValidEmail = (email) => /^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email);

export default function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [agreed, setAgreed] = useState(false);
  const navigate = useNavigate();

  const handleLogin = (e) => {
    e.preventDefault();
    if (!email.trim() || !password.trim()) {
      alert("Please fill in all fields.");
      return;
    }
    if (!isValidEmail(email)) {
      alert("Please enter a valid email address.");
      return;
    }
    if (!agreed) {
      alert("You must confirm you are 18 and above to proceed.");
      return;
    }
    navigate("/categories");
  };

  return (
    <div
      style={{
        minHeight: "100vh",
        backgroundColor: "#f8f8f8",
        fontFamily: "Inter, Arial, sans-serif",
        display: "flex",
        flexDirection: "column",
      }}
    >
      {/* Header */}
      <header
        style={{
          width: "100%",
          padding: "10px 30px",
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          backgroundColor: "#fff",
          boxShadow: "0 2px 6px rgba(0,0,0,0.05)",
        }}
      >
        <div style={{ display: "flex", alignItems: "center", gap: 10 }}>
          <img
            src="/logo-removebg-preview.png"
            alt="Black and White Logo"
            style={{ width: 120, height: "auto" }} // bigger logo
          />
        </div>
        <nav style={{ display: "flex", gap: 20 }}>
          <Link
            to="/login"
            style={{
              textDecoration: "none",
              color: "#000",
              fontWeight: 600,
              fontSize: 16,
            }}
          >
            Login
          </Link>
          <Link
            to="/register"
            style={{
              textDecoration: "none",
              color: "#000",
              fontWeight: 600,
              fontSize: 16,
            }}
          >
            Register
          </Link>
        </nav>
      </header>

      {/* Main content */}
      <main
        style={{
          flex: 1,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          padding: "2rem",
        }}
      >
        <form
          onSubmit={handleLogin}
          style={{
            width: "100%",
            maxWidth: 420,
            background: "#fff",
            padding: "2rem",
            borderRadius: 12,
            boxShadow: "0 10px 30px rgba(0,0,0,0.1)",
          }}
        >
          <h2
            style={{
              fontSize: 32,
              fontWeight: 700,
              color: "#000",
              textAlign: "center",
              margin: 0,
            }}
          >
            Login
          </h2>
          <p
            style={{
              fontSize: 16,
              color: "#555",
              textAlign: "center",
              marginTop: 8,
              marginBottom: 20,
            }}
          >
            Sign in to your account
          </p>

          {/* Email */}
          <div style={{ marginBottom: 16 }}>
            <label
              style={{
                display: "block",
                fontSize: 14,
                marginBottom: 6,
                color: "#111",
              }}
            >
              Email
            </label>
            <input
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              type="email"
              style={{
                width: "100%",
                padding: "12px 14px",
                borderRadius: 8,
                border: "1px solid #ccc",
                fontSize: 15,
                outline: "none",
              }}
              aria-label="Email"
            />
          </div>

          {/* Password */}
          <div style={{ marginBottom: 16 }}>
            <label
              style={{
                display: "block",
                fontSize: 14,
                marginBottom: 6,
                color: "#111",
              }}
            >
              Password
            </label>
            <input
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              type="password"
              style={{
                width: "100%",
                padding: "12px 14px",
                borderRadius: 8,
                border: "1px solid #ccc",
                fontSize: 15,
                outline: "none",
              }}
              aria-label="Password"
            />
          </div>

          {/* Checkbox */}
          <div
            style={{
              display: "flex",
              alignItems: "center",
              gap: 10,
              marginBottom: 20,
            }}
          >
            <input
              id="agreeLogin"
              type="checkbox"
              checked={agreed}
              onChange={() => setAgreed(!agreed)}
              style={{ width: 16, height: 16 }}
            />
            <label htmlFor="agreeLogin" style={{ fontSize: 14, color: "#111" }}>
              I agree I am 18yrs and above
            </label>
          </div>

          {/* Login button */}
          <button
            type="submit"
            disabled={!agreed}
            style={{
              width: "100%",
              padding: "12px",
              backgroundColor: agreed ? "#ff0000" : "#ff9a9a",
              color: "#fff",
              border: "none",
              borderRadius: 8,
              fontWeight: 700,
              fontSize: 16,
              cursor: agreed ? "pointer" : "not-allowed",
              transition: "background-color 0.2s",
              marginBottom: 14,
            }}
          >
            Login
          </button>

          <p style={{ textAlign: "center", fontSize: 14, color: "#111" }}>
            Don’t have an account?{" "}
            <Link
              to="/register"
              style={{
                color: "#ff0000",
                textDecoration: "none",
                fontWeight: 600,
              }}
            >
              Register
            </Link>
          </p>
        </form>
      </main>
    </div>
  );
}
